gdim = 2

a = []
for i in range(1, 6151):
    a.append(i)

b = []
for i in range(6150, 12299):
    b.append(i)
b.append(1)

mid_line = gmsh.model.occ.addLine(6150, 1)

spline_curves1 = gmsh.model.occ.addBSpline(a, degree=3)
spline_curves2 = gmsh.model.occ.addBSpline(b, degree=3)

spline_curve_loop1 = gmsh.model.occ.addCurveLoop([spline_curves1, mid_line], 1)
spline_surface1 = gmsh.model.occ.addPlaneSurface([spline_curve_loop1], 1)

spline_curve_loop2 = gmsh.model.occ.addCurveLoop([spline_curves2, -mid_line], 2)
spline_surface2 = gmsh.model.occ.addPlaneSurface([spline_curve_loop2], 2)

for i in range(1, 12300):
    gmsh.model.occ.remove([(0, i)])

# Points
A = gmsh.model.occ.addPoint(-0.5, -0.5, 0., 0.1)
B = gmsh.model.occ.addPoint(1.5, -0.5, 0., 0.1)
C = gmsh.model.occ.addPoint(1.5, 0.5, 0., 0.1)
D = gmsh.model.occ.addPoint(-0.5, 0.5, 0., 0.1)

# Lines
AB = gmsh.model.occ.addLine(A, B)
BC = gmsh.model.occ.addLine(B, C)
CD = gmsh.model.occ.addLine(C, D)
DA = gmsh.model.occ.addLine(D, A)

# Surfaces and final geometry
ABCDA = gmsh.model.occ.addCurveLoop([AB, BC, CD, DA])
rectangle = gmsh.model.occ.addPlaneSurface([ABCDA], 3)  # rectangle
# 3rd argument is marker of the surface domain_geometry
domain_geometry = gmsh.model.occ.cut(
    [(gdim, rectangle)], [(gdim, spline_surface1), (gdim, spline_surface2)], 4)

gmsh.model.occ.synchronize()

gmsh.model.mesh.field.add("Distance", 1)
gmsh.model.mesh.field.setNumbers(1, "CurvesList", [5, 6])

gmsh.model.mesh.field.add("MathEval", 2)
gmsh.model.mesh.field.setString(2, "F", "F1")

gmsh.model.mesh.field.setAsBackgroundMesh(2)

# 8=Frontal-Delaunay for Quads (See section 7.4,  https://gmsh.info/doc/texinfo/gmsh.html#Mesh-options)
gmsh.option.setNumber("Mesh.Algorithm", 5)
# 2=simple full-quad (See section 7.4,  https://gmsh.info/doc/texinfo/gmsh.html#Mesh-options)
gmsh.option.setNumber("Mesh.RecombinationAlgorithm", 2)
# Apply recombination algorithm to all surfaces, ignoring per-surface spec
gmsh.option.setNumber("Mesh.RecombineAll", 1)
# Mesh subdivision algorithm (0: none, 1: all quadrangles, 2: all hexahedra, 3: barycentric)
gmsh.option.setNumber("Mesh.SubdivisionAlgorithm", 1)
gmsh.option.setNumber("Mesh.MeshSizeMin", 0.02)  # Minimum characteristic element size
gmsh.option.setNumber("Mesh.MeshSizeMax", 0.5)  # Maximum characteristic element size
gmsh.model.mesh.generate(gdim)  # Mesh generation
gmsh.model.mesh.setOrder(1)  # Mesh order
# Mesh optimisation or improving quality of mesh
gmsh.model.mesh.optimize("Netgen")


# Extract edges and surfaces to add physical groups
surfaces = gmsh.model.getEntities(dim=gdim)
# Gives 'list' of boundaries in the form [(gdim-1),marker] with length = number of boundaries
edges = gmsh.model.getBoundary(surfaces)
# edges = gmsh.model.getEntities(dim=gdim-1) # Alternate to getting boundaries

for i in range(1, len(surfaces)+1):
    gmsh.model.addPhysicalGroup(gdim, [surfaces[i-1][1]], surfaces[i-1][1])
for i in range(1, len(edges)+1):
    gmsh.model.addPhysicalGroup(gdim-1, [edges[i-1][1]], edges[i-1][1])


gmsh.model.occ.remove(gmsh.model.getEntities(dim=gdim-1))
gmsh.model.occ.remove(gmsh.model.getEntities(dim=gdim))

gmsh.write("mesh.msh")
gmsh.fltk.run()

gmsh.finalize()

# Import mesh in dolfinx
gmsh_model_rank = 0
mesh_comm = MPI.COMM_WORLD

mesh, sudbdomains, boundaries = \
    dolfinx.io.gmshio.read_from_msh("mesh.msh", mesh_comm,
                                    gmsh_model_rank, gdim=gdim)

with dolfinx.io.XDMFFile(MPI.COMM_WORLD, "mesh.xdmf", "w") as mesh_file_xdmf:
    mesh_file_xdmf.write_mesh(mesh)
    mesh_file_xdmf.write_meshtags(boundaries)
